import React from "react";
import Entry from "./Entry";

const App = () => {
  return (
  <div className="max-w-lg items-center space-x-4 rounded-xl bg-orange-100 p-6 shadow-lg">
    <div>
      <div className="pb-5 text-center text-sm font-medium tracking-wider text-sky-900">I AM GRATEFUL FOR:</div>
      <Entry value="1."/>
      <Entry value="2."/>
      <Entry value="3." />
    </div>
  </div>
  );
}

export default App;
